/*Table structure for table `xt_res` */

DROP TABLE IF EXISTS `xt_res`;

CREATE TABLE `xt_res` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `hash` char(32) DEFAULT NULL COMMENT '资源md5值',
  `ext` char(10) DEFAULT NULL COMMENT '资源后辍名',
  `size` int(11) DEFAULT NULL COMMENT '资源大小',
  `type` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `hash_UNIQUE` (`hash`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='图片资源表';

/*Data for the table `xt_res` */

/*Table structure for table `xt_sessions` */

DROP TABLE IF EXISTS `xt_sessions`;

CREATE TABLE `xt_sessions` (
  `session_id` varchar(40) NOT NULL DEFAULT '0',
  `ip_address` varchar(45) NOT NULL DEFAULT '0',
  `user_agent` varchar(120) NOT NULL,
  `last_activity` int(10) unsigned NOT NULL DEFAULT '0',
  `user_data` text NOT NULL,
  PRIMARY KEY (`session_id`),
  KEY `last_activity_idx` (`last_activity`) USING BTREE
