/*Table structure for table `xt_user` */

DROP TABLE IF EXISTS `xt_user`;

CREATE TABLE `xt_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(225) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `district` int(11) DEFAULT NULL COMMENT '区域id',
  `pid` int(11) DEFAULT NULL COMMENT '父id',
  `type` varchar(20) DEFAULT '0' COMMENT '0默认 1来自微信',
  `openid` varchar(50) DEFAULT NULL,
  `nickname` varchar(255) DEFAULT NULL COMMENT '昵称',
  `email` varchar(255) DEFAULT NULL,
  `regip` varchar(255) DEFAULT NULL,
  `regtime` int(10) DEFAULT NULL,
  `lastlogin` int(10) DEFAULT '0' COMMENT '最后登入时间',
  `activity` int(10) DEFAULT '0' COMMENT '活动时间',
  `lastip` varchar(255) DEFAULT '0' COMMENT '最后登入IP',
  `token` varchar(255) DEFAULT NULL,
  `gid` int(11) DEFAULT '4',
  `status` tinyint(2) DEFAULT '1',
  `create_time` int(11) DEFAULT NULL,
  `params` text COMMENT '其它参数',
  PRIMARY KEY (`id`),
  KEY `user_id` (`id`) USING BTREE,
  KEY `user_id_2` (`id`) USING BTREE,
  KEY `user_id_3` (`id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=66 DEFAULT CHARSET=utf8 COMMENT='用户表';

